import { Typography } from '@material-ui/core';
import Typewriter from 'typewriter-effect';

import React from 'react';

const ThreadView: React.FC = () => {
    return (
            <Typography style={{ padding: '1em 0' }} variant='h4' align='left'>
                <Typewriter
                    onInit={(typewriter) => {
                        typewriter
                            .changeDelay(5)
                            .typeString("Good programmers write code that humans can understand.")
                            .pauseFor(100)
                            .start();
                    }}
                />
            </Typography>
    );
};

export default ThreadView;
